import React from 'react';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import {DialogTitle, Button,Typography }from '@material-ui/core';
import MuiDialogTitle from '@material-ui/core/DialogTitle';
import MuiDialogContent from '@material-ui/core/DialogContent';
import MuiDialogActions from '@material-ui/core/DialogActions';
import IconButton from '@material-ui/core/IconButton';
import CloseIcon from '@material-ui/icons/Close';
import { GreenButton, BlueButton } from './Atribut';
import { makeStyles,useTheme,withStyles } from '@material-ui/core/styles';


function Popup(props) {
    const{ openPopup,setOpenPopup} = props;
    const{ closePopup,setClosePopup} = props;

    const useStyles = makeStyles((theme) => ({
      tittle: {
        fontSize:"80px",
        fontWeight:900
      }

    }));

    const styles = (theme) => ({
      root: {
        margin: 0,
        padding: theme.spacing(2),
      },
      closeButton: {
        position: 'absolute',
        right: theme.spacing(1),
        top: theme.spacing(1),
        color: theme.palette.grey[500],
      },
    });

    const DialogTitle = withStyles(styles)((props) => {
      const { children, classes, onClose, ...other } = props;
      return (
        <MuiDialogTitle disableTypography className={classes.root} {...other}>
          <Typography variant="h6">{children}</Typography>
          {onClose ? (
            <IconButton aria-label="close" className={classes.closeButton} onClick={onClose}>
              <CloseIcon />
            </IconButton>
          ) : null}
        </MuiDialogTitle>
      );
    });

    const classes = useStyles();
    const theme = useTheme();
    return (

        <div>
      <Dialog  aria-labelledby="customized-dialog-title" open={openPopup}>
        <DialogTitle id="customized-dialog-title"  onClick={()=>{setOpenPopup(false)}}  >
          Login
        </DialogTitle>
        <DialogContent >
        <TextField 
          fullWidth
         id="standard-required" label="Email/username" defaultValue="Hello World" />

        <TextField
            autoFocus
            margin="20px 0px 20px 0px"
            id="name"
            label="Password"
            type="password"
            fullWidth
          />
        </DialogContent>
        <DialogActions>
          <BlueButton>Login</BlueButton>

        </DialogActions>
        <BlueButton style={{backgroundColor:"#155547"}}> Register</BlueButton>
      </Dialog>

        </div>
    );
}

export default Popup;
